import React from "react";
import "./Results.css";

const Results = props => (

  <div className="card">
    <h3 className="card-header">Results</h3>
    <div className="card-body">
      <h4>Search for articles to begin!</h4>
    </div>

    <img
      alt={props.title}
      className="img-fluid"
      src={props.src}
      style={{ margin: "0 auto" }}
    />
    <h3>Director(s): {props.director}</h3>
    <h3>Genre: {props.genre}</h3>
    <h3>Released: {props.released}</h3>
  </div>
);

export default Results;
